var timeX = getTime()

function App() {
  var time = 'null'
  time=timeX
  return (
    <div className="App">
      <header className="App-header">
        <p>
          The time is {time}.
        </p>
        <button>testings</button>
      </header>
    </div>
  );
}


function getTime() {
  fetch('http://localhost:3001')
  .then((response) =>{
    timeX=response.text()
  })
  .catch((error) => {
    console.log(error)
  });
}
export default App;
